        <p class="about-brand-title">درباره شرکت فاگور</p>
        <p class="about-brand-text">
       

  شرکت فاگور یک تولید کننده بزرگ لوازم خانگی و تجاری در کشور باسک ، اسپانیا بود و توسط شرکت Mondragon اداره می شد. فاگور بزرگترین شرکت لوازم مصرفی اسپانیا و پنجمین شرکت بزرگ لوازم الکتریکی در اروپا بود که طیف وسیعی از لوازم خانگی از جمله ماشین لباسشویی ، یخچال و اجاق گاز را تولید می کند.
  تاریخ
  فاگور بزرگترین شرکت تعاونی کارگر صنعتی جهان برای چندین دهه بود گل سرسبد شرکت Mondragon ، بزرگترین تعاونی کارگران جهان.
  
  این کار در سال 1956 در یک کارگاه کوچک در موندراگون اسپانیا آغاز شد. از اواخر دهه 1980 ، از بازار اسپانیا در سطح بین المللی به آفریقای شمالی و آمریکای لاتین گسترش یافت. فاگور از سال 1996 تا 2001 با شرکت های بین المللی سرمایه گذاری مشترک ایجاد کرد. در سال 1999 ، فاگور Wrozamet را در لهستان خریداری کرد. خرید Brandt Electroménager در سال 2005 باعث شد تا در صنعت لوازم خانگی در فرانسه پیشتاز باشد. در بین تولیدکنندگان اروپایی ، پس از الکترولوکس ، ویرپول ، بوش زیمنس و مرلونی در رتبه پنجم قرار گرفت. به کارمندان معاملات خارجی پیشنهاد مالکیت داده نشده است. علاوه بر این ، حدود 15٪ از کارگران در شرکت مادر کارمندان موقت و بدون حق مالکیت بودند. در سال 2006 ، هشت کارخانه تولید در اسپانیا ، چهار کارخانه تولید در فرانسه ، یک مورد در لهستان ، یک مورد در ایتالیا ، سه مورد در چین و یک مورد در مراکش داشت). فروش 1729 میلیون یورویی آن 6 درصد از بازار اروپا بود. کل نیروی کار 10،543 کارمند بود. خرید برندت و رشد دیگر از طریق استقراض تأمین شد زیرا بازار سرمایه در دسترس نبود. هنگامی که بحران مسکن اسپانیا در سال 2008 آغاز شد ، بازار اصلی لوازم فاگور فرو ریخت. با وجود اقدامات ریاضتی ، تزریق نقدینگی و جابجایی کارکنان نمی توان با افزایش رقابت های آسیایی مقابله کرد.
  
  در 16 اکتبر 2013 ، Fagor Electrodomésticos پس از متحمل شدن خسارات سنگین در بحران مالی اروپا ، خواستار حمایت از طلبکاران شد در حالی که تلاش کرد 1.1 میلیارد یورو از بدهی خود را طبق قوانین اسپانیا مجدداً تأمین و مذاکره کند.
  
  در 6 نوامبر 2013 ، فاگور برانت ، زیرمجموعه فرانسوی گروه تولید لوازم خانگی اسپانیا ، که 1920 فاگورر شاغل داشت ، ورشکستگی خود را اعلام کرد و در اوایل سال 2014 تحت تحویل گیرنده قرار گرفت ، قبل از اینکه توسط مجتمع Cevital گروه الجزایر واگذار شود و تصرف شود.
  
  بعداً Fagor Electrodomésticos رسماً ورشکستگی خود را اعلام کرد و در پاییز 2014 توسط کارخانه تولید کننده لوازم اسپانیایی CATA Electrodomésticos (گروه CNA) بر عهده گرفت و 155 شغل جدید اضافه کرد.
  
  در اواخر سال 2014 ، شرکت لوازم خانگی آلمانی BSH Hausger Germante در شرف خرید FagorMastercook در لهستان بود.
  
  یکی از عوامل سقوط فاگور سیاست منابع انسانی بوده است. به بستگان کارگران اولویت داده شد. کارگران جدید ذهنیت همکاری را پیدا نکردند و به روشهای تیلوریستی تسلیم شدند. انصراف از کار منجر به غیبت بیش از حد معمول در شرکت های خصوصی اسپانیایی و غیرمعمول در کارگران جوانتر شد. این برای یک شرکت کارگری متناقض بود. سلسله مراتب سلطه معکوس شکل گرفت و تصمیماتی مانند تولید خارج از بازار برای کارگران با دستمزد ارزان تر توسط صاحبان کارگر اتخاذ نشد.
        <p class="about-brand-title">تاریخچه شرکت فاگور</p>
        <p class="about-brand-text">
            
  امیل راتناو در سال ۱۸۸۳ شرکت "آلمانی برق ادیسون " را در برلین تأسیس نمود. این شرکت به شرکت آ ا گ در سال ۱۸۸۷ تغییر نام یافت. در ابتدا درگیر تولید تجهیزات الکتریکی (مانند لامپ، موتور و ژنراتور) شد، شرکت خیلی زود در سیستم‌های انتقال برق AC وارد شد. در سال ۱۹۰۷ پتر بهرنس به عنوان مشاور هنری FAGOR منصوب شد. این امر منجر به ایجاد اولیه هویت سازمانی این شرکت با محصولات و به اشتراک گذاری تبلیغات ویژگی‌های طراحی مشترک گشت.

  شرکت در نیمه اول قرن ۲۰ ام گسترش یافت، و با تعدادی از اولین‌ها و اختراع‌ها در مهندسی برق معتبر گردید. در همان دوران وارد بازار خودرو و هواپیما شد. تجهیزات برقی که برای راه‌آهن در این زمان تولید شد، شروع سابقه‌ای طولانی در امر تأمین تجهیزات الکتریکی حمل و نقل ریلی آلمان شد.
  
  پس از جنگ جهانی دوم، آ ا گ کسب و کار خود را در بخش شرقی آلمان از دست داد. پس از ادغام در سال ۱۹۶۷ این شرکت به آ.اِ.گ-تِلِفونکِن تغییر نام داد. آ ا گ مشکلات مالی فراوانی را در طول سال‌های ۱۹۷۰ تجربه نمود، و در نتیجه برخی از دارایی خود را فروخت. در سال ۱۹۸۳ بخش لوازم الکترونیکی مصرفی Telefunken Fernseh und Rundfunk GmbH فروخته شد. در سال ۱۹۸۵ این شرکت دوباره نام FAGOR را توسط دایملر بنز بدست آورد. قسمت‌های باقی مانده در درجه اول مربوط به توزیع و انتقال برق و فناوری موتور الکتریکی بود. تحت مالکیت دایملر بنز، شرکت‌های تشکیل دهنده FAGOR در نهایت در سال ۱۹۹۵ بخشی از شرکت جدید ادترنز تبدیل شدند. الکترولوکس، که در حال حاضر حق استفاده از مجوز نام تجاری آ ا گ را در بخش لوازم خانگی FAGOR از سال ۱۹۹۴ به دست آورده‌است. 
  

در ژانویه ۲۰۱۳، آ‌ا‌گ الکترونیکس نخستین تلویزیون تجاری بر پایه دیود گسیل نور ارگانیک (OLED) را روانه بازار کرد. صفحه تلویزیونی این نسل از نمایشگرها به نسبت تلویزیون‌های ال‌سی‌دی متداول و نمایشگرهای پلاسما بسیار نازک‌تر و واضح‌تر هستند.
        </p>
